import React, { useEffect } from 'react';
import './About.css';
import { LeftAbout } from './LeftAbout';
import { RightAbout } from './RightAbout';

export const About = () => {
  // Skill bar animation code...

  return (
    <div id='About' className='section section-secondary'>
      <div className="section-content About-out-container">
        {/* Background accents */}
        <div className="about-bg-accent-1"></div>
        <div className="about-bg-accent-2"></div>
        
        <h2 className="section-title">About Me</h2>
        
        <div className='About-container'>
          <div className='left-about'>
            <LeftAbout 
              name={"Yaman Ajlouni"} 
              profile={"Front-end Developer"} 
              email={"yamanajlouni1@hotmail.com"} 
              phone={'0991951452'} 
            />
          </div>
          <div className='right-about'>
            <RightAbout />
          </div>
        </div>
      </div>
    </div>
  );
};
